import React from "react";
import styles from "./Comment.module.css";
const Comment = ({ user, content, id }) => {
  return (
    <div className={styles.comment}>
      <div className={styles.poster}>
        <p>{user.name}</p>
        <p>{user.username}</p>
      </div>
      {user.username} {content} {id}
    </div>
  );
};

export default Comment;
